import React from 'react'

const HeaderComponent = () => {
  return (
    <header className='navbar navbar-expand-md navbar-dark bg-dark'>
        <div className='container'>
            <a href="">Employee Management System</a>
        </div>
    </header>
  )
}

export default HeaderComponent
